// This is the Navigation Bar
import "./App.css";
import { BrowserRouter, Route, Switch, Link } from "react-router-dom";
import App from "./App";

function Header() {
  return (
    <BrowserRouter>
      <Switch>
        <div className="Header">
          <Link to="/App">
            <button className="Home" aria-label="Home">
              Home
            </button>
          </Link>
        </div>
      </Switch>
    </BrowserRouter>
  );
}

export default Header;
